describe('The SMS/OTP authentication flow', () => {
    before(() => {
        cy.fixture("kiva_agent.json").then(info => {
            let common = info.common,
                fetchProofs = info.fetchProofOptions;
            cy.intercept(fetchProofs.method, fetchProofs.endpoint, {
                ...common,
                body: fetchProofs.success
            });
        });
        cy.visit('/');
        cy.get('.accept').click();
        cy.wait(200);
        cy.contains('Continue').click();
        cy.selectAuthMenuItem().eq(1).click();
        cy.get('#select-auth-method').click();
    });

    it('navigates back to the Authentication Options Menu when clicking "Back"', () => {
        cy.get('#back').click();
        cy.get('#auth_options').should('be.visible');
        cy.get('#select-auth-method').click();
    });

    it('surfaces a toast notification if no e-mail is entered into the form', () => {
        cy.get('#continue').click();
        cy.get('.toast-notification').should('contain', 'Please enter your email in the field below');
    });

    it('automatically closes the toast notification after 3 seconds', () => {
        cy.wait(3000);
        cy.get('.toast-notification').should('not.exist');
    });

    it('navigates to the SMS/OTP screen after entering an e-mail and clicking "Continue"', () => {
        cy.get('#email-input').type('cutest.kitty@kiva.org');
        cy.get('#continue').click();
        cy.get('[name="phoneNoInput"]').should('be.visible');
    });

    it.skip('persists the e-mail when clicking back from the SMS/OTP screen', () => {
        cy.get('[data-cy="smsotp-back"]').click();
        cy.get('#email-input').should('contain', 'cutest.kitty@kiva.org');
    });

    it.skip('navigates to the SMS/OTP screen after hitting "Enter" with a valid e-mail entered', () => {
        cy.get('#email-input').type('{enter}');
    });

    it('surfaces a toast notification if "Verify" is clicked without entering a phone number', () => {
        cy.get('#sms-scan-verification-button').click();
        cy.get('.toast-notification').should('contain', 'Please enter a valid phone number');
    });

    it('automatically closes the toast notification after 3 seconds', () => {
        cy.wait(3000);
        cy.get('.toast-notification').should('not.exist');
    });

    it('successfully begins processing the request if a phone number has been entered', () => {
        cy.intercept('/v2/kiva/api/guardian/verify', {
            delay: 500,
            statusCode: 400
        });
        cy.get('[name="phoneNoInput"]').type("4158675309");
        cy.get('#sms-scan-verification-button').click();
        cy.get('[data-cy="sms-otp-in-progress"]').should('be.visible');
        cy.wait(500);
    });

    it('successfully displays an error when a request fails', () => {
        cy.get('.dialog-icon.error').should('be.visible');
    });

    it('returns to the phone number input when clicking "Back" after a failure', () => {
        cy.get('[data-cy="smsotp-back"]').click();
        cy.get('[name="phoneNoInput"]').should('be.visible').and('have.attr', 'value', '+1 (415) 867-5309');
    });

    it('navigates to the OTP entry screen if the request is successful', () => {
        cy.intercept('/v2/kiva/api/guardian/verify', {
            delay: 500,
            statusCode: 201,
            body: {
                status: 'sent',
                id: null
            }
        });
        cy.get('[name="phoneNoInput"]').type('{enter}');
        cy.get('#otp-row').should('be.visible');
    });

    it('does not start the OTP request if the inputs are empty', () => {
        cy.get('[data-cy="fpscan-next"]').click();
        cy.get('#otp-row').should('be.visible');
    });

    it('does not start the OTP request if there is a non-number in the inputs', () => {
        cy.otpInput('hijklm');

        cy.get('[data-cy="fpscan-next"]').click();
        cy.get('#otp-row').should('be.visible');
    });

    it('renders an error when the OTP request fails', () => {
        cy.intercept('/v2/kiva/api/guardian/verify', {
            statusCode: 400
        });

        cy.otpInput('123456');

        cy.get('[data-cy="fpscan-next"]').click();
        cy.get('.dialog-icon.error').should('be.visible');
    });

    // TODO
    // There's some business logic surrounding how the "Back" should work in the case of a failure
    //    1) The OTP has expired - in that case, the user should be navigated to the phone number input
    //    2) The OTP is incorrect - in that case, the user should be navigated back to the OTP input page
    //
    // We should find an scalable way to handle errors for SMS/OTP, along with the ability to differentiate between the two failures outlined
    // In the meantime...

    it('renders a success icon when the OTP request is successful', () => {
        cy.intercept('/v2/kiva/api/guardian/verify', {
            statusCode: 201,
            body: {
                "firstName": "Calliope",
                "lastName": "Gata",
                "photo~attach":
                "",
                "type": "Full Time",
                "endDate": "NEVER!",
                "companyEmail": "cutest.kitty@kiva.org",
                "phoneNumber": "867-5309",
                "officeLocation": "San Francisco",
                "hireDate": "2019-06-17",
                "team": "Kiva Protocol",
                "currentTitle": "Kiva's Cutest Kitty"
            }
        });
        cy.get('[data-cy="smsotp-back"]').click();
        cy.get('[name="phoneNoInput"]').type("4158675309{enter}");
        
        cy.otpInput('123456');

        cy.get('[data-cy="fpscan-next"]').click();
        cy.get('.dialog-icon.verified').should('be.visible');
    });
});